import requests
import json
import math

secrets = json.load(open("secrets.json"))


class WeatherAPI:
    DEFAULT_ZIP = secrets['WeatherInfo']['ZIP_Code']
    URL_FORMAT = "http://api.openweathermap.org/data/2.5/weather?zip={zipcode},us&APPID=" + secrets[
        'WeatherInfo']['WeatherAPI_Key']

    def __init__(self, zipcode=None):
        self.zipcode = zipcode or self.DEFAULT_ZIP

    @property
    def url(self):
        return self.URL_FORMAT.format(zipcode=self.zipcode)

    @property
    def get(self):
        response = requests.get(self.url)
        data = response.json()
        return Weather(
            description=data['weather'][0]['description'].title(),
            wind=data['wind']['speed'],
            temp=data['main']['temp'],
            weather_ID=data['weather'][0]['id'])


class Weather:
    def __init__(self, *, description, wind, temp, weather_ID):
        self.description = description
        self._temp = temp
        self.wind = wind
        self.weather_ID = weather_ID

    @property
    def temp_f(self):
        return kelvin_to_fahrenheit(self._temp)

    def get_image_URL(self):
        if 200 <= self.weather_ID < 300:
            return "data:image/jpeg;base64,"
        elif 300 <= self.weather_ID < 400:
            return "data:image/jpeg;base64,"
        elif 500 <= self.weather_ID < 600:
            return "data:image/jpeg;base64,"
        elif 600 <= self.weather_ID < 700:
            return "data:image/jpeg;base64,"
        elif self.weather_ID == 800:
            return "data:image/jpeg;base64,"
        elif 801 <= self.weather_ID < 804:
            return "data:image/jpeg;base64,"
        elif self.weather_ID == 804:
            return "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTlSFZ2MPzqOgA95oKgbTG1xwRGGNhnMDTRXhO-8KOgaABjv_vQ_A"
        else:
            return "data:image/jpeg;base64,"


def kelvin_to_fahrenheit(k):
    return math.floor((int(k) - 273.15) * (9 / 5) + 32)
